I was a franchisee of @letsblinkit  (earlier Grofers) and had taken a place with rental deposit. At 12 months, the landlord asked for rental revision request. I requested Blinkit for the same. They closed the store within a week, in violation of the agreement which required them to give 30 days notice. My landlord took 4 months advance due to lack of notice. Now, my landlord has not returned the rental deposit. Blinkit is saying it is not their responsibility. I have borne all one month overheads and staff settlements from my pocket. Blinkit is not responding properly or meeting me. They have been harassing me since February end.

I am seeking help from the authorities to resolve this issue.  I am also seeking legal advice.

I urge all franchisees of #Blinkit to be aware of their rights and to stand up against exploitation.

